import React from "react";
import "./index.css";


function Card(props){
    return(
        
           <div className="card">
               <img src={props.imageSrc}/>
               <div className="cardsDetl">
                   <h1>{props.name}</h1>
               </div>
            </div>
           
    )
}
export default Card;
